  'AdminAdvparametersHelp' => 
  array (
    'Warning: Enabling the "share customers" and "share orders" options is not recommended. Once activated and orders are created, you will not be able to disable these options. If you need these options, we recommend using several categories rather than several shops.' => 'Զգուշացում. Խորհուրդ չի տրվում միացնել «Ընդհանոււր հաճախորդներ» եւ «Ընդհանուր պատվերներ» պարամետրերը, քանի որ դրանից հետո պատվերների կամ հաճախորդների ստեղծման ժամանակ Դուք արդեն չեք կարող անջատել այս պարամետրերը: Իսկ եթե Ձեզ անհրաժեշտ են այս պարամետրերը, հավանական է, պետք է օգտագրոծել մի քանի կատեգորիաներ  մի քանի խանութների փոխարեն',
    'New modules and updates are displayed on the modules page.' => 'Նոր մոդուլները եւ թարմացումները ցույց են տրված մոդուլների էջին',
    'Check the IP address of the cookie in order to prevent your cookie from being stolen.' => 'Ստուգեցեք cookie -ի IP հասցեն, որպեսզի կանխվի Ձեր cookie -ն գողացվելուց',
    'This will display notifications when new orders are made in your shop.' => 'Սա ցույց կտա ծանուցումները, երբ Ձեր խանությում նոր պատվերներ կստացվեն',
    'This will display notifications every time a new customer registers in your shop.' => 'Սա ամեն անգամ ցույց կտա ծանուցումները, երբ մի նոր հաճախորդ կգրանցվի Ձեր խանութում',
    'This will display notifications when new messages are posted in your shop.' => 'Ծանուցումներ Ձեր խանութի նոր հաղորդագրությունների մասին',
    'If enabled, the backup script will drop your tables prior to restoring data.' => 'Եթե միացած է, պահուստային կրկօրինակման սցենարը կջնջի գոյություն ունեցող աղյուսակները մինչեւ տվյալների վերականգնումը',
    'Where customers send messages from the order page.' => 'Ուր են բաժանորդները ուղարկում հաղորդագրությունները պատվերի էջից',
    'Fully qualified domain name (keep this field empty if you don\'t know).' => 'Դոմենի լրիվ անունը (թողեք այս դաշտը դատարկ եթե չգիտեք)',
    'Leave blank if not applicable.' => 'Թողնել դատարկ, եթե կիրառելի չէ',
    'Use an encrypt protocol' => 'Օգագործել կոդավորված փոխանակման կանոնները',
    'URL rewriting must be activated on your server to use this feature.' => 'Հղման վերագրառումը պետք է ակտիվացված լինի սերվերի վրա, որպեսզի այս ֆունկցիան օգտագործվի',
    'If you set this URL as the Main URL for the selected shop, all URLs set to this shop will be redirected to this URL (you can only have one Main URL per shop).' => 'Եթե Դուք այս Հղումը դնեք որպես հիմնական Հղում ընտրած խանութի համար, ապա այս խանութի ողջ Հղումների հավաքածուն կվերաուղորդվի (կարող է խանութի համար լինել միայն մեկ հիմնական Հղում)',
    'Since the selected shop has no main URL, you have to set this URL as the Main URL.' => 'Քանի որ ընտրված խանութի համար չկա հիմնական Հղում, Դուք պետք է այս հղումը դնեք որպես հիմնական',
    'This option should be used in a production environment.' => 'Այս օպցիան  պետք է օգտագործվի միայն արտադրական միջավայրում',
    'Templates are recompiled when they are updated. If you experience compilation troubles when you update your template files, you should use Force Compile instead of this option. It should never be used in a production environment.' => 'Ձեւանմուշները կվերակազմավորվեն թարմացնելու ժամանակ, եթե Դուք կհանդիպեք վերակազմավորման  հետ կապված խնդիրների, ձեւանմուշների ֆայլերի թարմացումից հետո, ապա  խորհուրդ է տրվում օգտագործել Ստիպողական վերկազմավորումը: Այս օպցիան չպետք է օգտագործվի աշխատող կայքերի համար',
    'This forces Smarty to (re)compile templates on every invocation. This is handy for development and debugging. Note: This should never be used in a production environment.' => 'Ստիպօղական վերակազմավորում յուրաքանչյուր դիմելու ընթացքում: հարմար է զարգացման եւ կագաբերման ժամանակ, սակայն այն չի կարելի միացնել մարտական ռեժիմով',
    'Some features can be disabled in order to improve performance.' => 'Որոշ հատկանիշներ կարող են անջատվել որպեսզի բարելավվի կատարողականությունը',
    'CCC allows you to reduce the loading time of your page. With these settings you will gain performance without even touching the code of your theme. Make sure, however, that your theme is compatible with PrestaShop 1.4+. Otherwise, CCC will cause problems.' => 'ՄՍՔ Ձեզ թույլ է տալիս նվազեցնել  Ձեր էջի բեռնելու ժամանակը: Այս կարգավորումներով դուք կավելացնեք Ձեր ձեւանմուշի կարողունակությունը նույնիսկ առանց կոդին ձեռք տալու: Սակայն, համոզվեք որ Ձեր ձեւանմուշը համատեղելի է PrestaShop 1.4+ _ի հետ: Հակառակ դեպքում, ՄՍՔ -ն խնդիրների պատճառ կդառնա',
    'This will add directives to your .htaccess file, which should improve caching and compression.' => 'Սս թույլ է տալիս հրահանգներ ավելացնել .htaccess ֆայլի մեջ, որը լավացնում է քեշավորումը ու սեղմումը',
    'Name of the second domain of your shop, (e.g. myshop-media-server-1.com). If you do not have another domain, leave this field blank.' => 'Խանութի երկրորդ դոմենի անվանումը (օրինակ myshop-media-server-1.com ): Եթե այն չկա , թողեք դաշտը դատարկ',
    'Name of the third domain of your shop, (e.g. myshop-media-server-2.com). If you do not have another domain, leave this field blank.' => 'Խանութի երրորդ դոմենի անվանումը (օրինակ myshop-media-server-2.com ): Եթե այն չկա , թողեք դաշտը դատարկ',
    'Name of the fourth domain of your shop, (e.g. myshop-media-server-3.com). If you do not have another domain, leave this field blank.' => 'Խանութի չորորդ դոմենի անվանումը (օրինակ myshop-media-server-3.com ): Եթե այն չկա , թողեք դաշտը դատարկ',
    'Enter "5" if you do not want to receive any emails.' => 'Մուտքագրեք «5» եթե չեք ուզում ստանալ ոչ մի էլ. նամակ',
    'Emails will be sent to the shop owner.' => 'Էլ. նամակները կուղարկվեն խանութի տիրոջը',
    '-- Choose --' => '-- Ընտրել --',
    'Before activating the webservice, you must be sure to: ' => ' ',
    'Check that the five methods GET, POST, PUT, DELETE and HEAD are supported by this server.' => 'Ստուգեք որ այս հինգ մեթոդները  GET, POST, PUT, DELETE եւ HEAD իրականացվում են այս սերվերի կողմից',
    'Use this option to associate data (products, modules, etc.) the same way for each selected shop.' => 'Օգտագործեք այս օպցիան, որպեսզի նշանակեք տվյալները (ապրանքներ, մոդուլներ եւ այլն) ընտրած խանութի համար',
    'Click "Add New".' => 'Սեղմել «Ավելացնել նորը»',
    'Fill in the fields and click "Save".' => 'Լրացրեք դաշտերը ու սեղմեք «Պահպանել»',
    'Ignore this field if you don\'t use the Multistore tool. If you leave this field empty, the default shop will be used.' => 'Անտեսեք այս դաշտը եթե Դուք չեք օգտագործում «Մի քանի խանութներ» ֆունկցիան: Եթե այս դաշտը լրացված չէ, ապա կօգտագործվի դեֆոլտ դրված խանությը',
    'A category root is where a category tree can begin. This is used with multistore.' => 'Կատեգորիան համարվում է արմատ եթե կատեգորիաների ծառը սկսվում է նրանից: Օգտագործվում է «Մի քանի խանութներ» ֆունկցիայի հետ',
    'or' => 'կամ',
    'Set "Enable Shop" to "No" in the "Maintenance" page under the "Preferences" menu.' => 'Դնել «Խանութը միացած է»- ի դիմաց «Ոչ», «Սպասարկում» էջին, «Կարգավորումներ» մենյուի տակ',
    'Download the backup from the list below or from your FTP server (in the folder "admin/backups").' => 'Ներբեռնեք պահուստային կրկնօրինակը ներքեւի ցանկից կամ Ձեր FTP սերվերից (թղթապանակ «ադմին/պահ. կրկ.»)',
    'Check the backup integrity: Look for errors, incomplete file, etc... Be sure to verify all of your data.' => 'Ստուգեք պահուստային կրկնօրինակի ամբողջականությունը. փնտրեք սխալները, ոչ լրիվ ֆայլերը եւ այլն ... Համոզվեցեք որ ստուգել եք Ձեր բոլոր տվյալները',
    'Please ask your hosting provider for "phpMyAdmin" access to your database.' => 'Խնդրեք Ձեզ ծառայություն մատուցող հոսթինգ պրովայդերին մուտք գործելու «phpMyAdmin» տվյալների բազա',
    'Connect to "phpMyAdmin" and select your current database.' => 'Միացեք «phpMyAdmin»-ին եւ ընտրեք անհրաժեշտ տվյալների բազան',
    'Unless you enabled the "Drop existing tables" option, you must delete all tables from your current database.' => 'Եթե «աղյուսակների հեռացում» միջոցը միացված չէ. Դուք պետք է աղյուսակները հեռացնեք ընթացիկ  տվյալների բազայից',
    'At the top of the screen, please select the "Import" tab' => 'Էկրանի վերեւում, խնդրում ենք ընտրել «ներմուծել»  կոճակը',
