    'We could not check to see if basic authentication and rewrite extensions have been activated. Please manually check if they\'ve been activated in order to use the PrestaShop webservice.' => '«mod_auth_basic» եւ «mod_rewrite» հասանելոիթության ավտոմատ ստուգումը չհաջողվեց: Այն ստուգեցեք ձեռքերով, նախքան Վեբծառայությունների ակտիվացումը',
