    'This %1$s field (%2$s) is too long: %3$d chars max (current count %4$d).' => 'Այս %1$s  դաշտը (%2$s) շատ երկար է. առավելագույնը %3$d նշան (ներկայիս քանակը %4$d):',
    'The expiration-date attribute is required.' => 'Պիատանիության ժամկետ հատկանիշը պահանջվում է:',
    'An error occurred while attempting to delete previous tags.' => 'Սխալ է հայտնվել նախորդ թեգերը ջնջելու փորձ կատարելու ընթացքում:',
    'An error occurred while copying the image.' => 'Սխալ է հայտնվել պատկերը կրկնօրինակելու ընթացքում',
    'You can\'t add product packs into a pack' => 'Դուք չեք կարող ավելացնել ապրանքների կոմպլեկտը մեկ այլ կոմպլեկտի մեջ:',
