    'Unable to initialize these parameters. A combination is missing or an object cannot be loaded.' => 'Չի ստացվում ինիցիալացնել պարամետրերը, կոմբինացիան բացակայում է կամ հնարավոր չէ բեռնել օբյեկտը:',
    'You do not have permission to add suppliers.' => 'Ձեզ թույլատրված չէ ավելացնել մատակարարների:',
