  'AdminDesignHelp' => 
  array (
    'JPEG images have a small file size and standard quality. PNG images have a larger file size, a higher quality and support transparency. Note that in all cases the image files will have the .jpg extension.' => 'JPEG -ը փոքրածավալ ու ստանդարտ որակի ֆայլ է: PNG -ի ֆայլը ունի մեծ ծավալ ավելի բարձր որակով եւ ունի թափանցիկություն: Ուշադրություն դարձրեք , որբոլոր դեպքերում, պատկերների ֆայլերը կունենան JPG ընդլայնում',
    'WARNING: This feature may not be compatible with your theme, or with some of your modules. In particular, PNG mode is not compatible with the Watermark module. If you encounter any issues, turn it off by selecting "Use JPEG".' => 'Նախազգուշացում. Այս հատկությունը, հնարավոր է, համատեղելի չէ Ձեր ձեւանմուշի կամ մի քանի մոդուլների հետ: Մասնավորապես, PNG ռեժիմը համատեղելի չէ Ջրային նշանների մոդուլի հետ: Եթե Դուք կբախվեք որեւէ խնդրի հետ, անջատեք այն ընտրելով. «Օգտագործել JPEG»',
    'Ranges from 0 (worst quality, smallest file) to 100 (best quality, biggest file).' => 'Սկսած 0 -ից (ամենավատ որոկը) միչեւ 100 (ամենալավ որակը, մեծ ֆայլեր)',
    'This should be set to yes unless you successfully moved images in "Images" page under the "Preferences" menu.' => 'Խորհուրդ է տրվում միացնել այս օպցիան դնելով «Այո», միայն եթե դուք նախապես չեք տեղափոխել պատկերներ «Պատկերներ» էջը «Կարգավորումներ» մենյուի մեջ',
    'This type will be used for Supplier images.' => 'Այս տեսակը կկիրառվի Մատակարարների պատկերներին',
    'This type will be used for Store images.' => 'Այս տեսակը կկիրառվի Խանութի պատկերներին',
    'Will appear on email headers. If undefined, the header logo will be used.' => 'Կհատնվի էլ. փոստի գլխամասում: Եթե սահմանված չէ, կօգտագործվի կայքի ամբողջական տարբերակի  պատկերանիշը',
    'Will appear in the address bar of your web browser.' => 'Կհայտնվի Ձեր դիտարկիչի հասցեի տողում',
    'You must select a shop from the above list if you wish to choose a theme.' => 'Դուք պետք է ցուցակից խանութ ընտրեք, եթե ուզում եք ձեւանմուշ ընտրել',
    'To add "tags" click in the field, write something, and then press "Enter."' => '«Տեգեր»  ավելացնելու համար սեղմեք դաշտի մեջ, գրեք ինչոր բան եւ հետո սեղմեք «Enter»',
    'Regenerates thumbnails for all existing images' => 'Վերաստեղծել մանրապատկերները բոլոր ունեցած ապրանքների պատկերների',
    'Please be patient. This can take several minutes.' => 'Այս գործողությունը կարող է երկար տեւել',
    'Be careful! Manually uploaded thumbnails will be erased and replaced by automatically generated thumbnails.' => 'Եղեք՛ ուշադիր: Ձեռքով ստեղծված մանրապատկերները կփոխարինվեն  ավտոմատ կերպով ստեղծվածներով',
    'Please specify the files for which you do not want the module to be displayed.' => 'Որոշեք այն ֆայլերը, որոնց համար մոդուլը պետք է երեւա',
  ),
