    'You should only activate this option if you are using non-latin characters ; for all the latin charsets, your SEO will be better without this option.' => 'Այս օպցիան ակտիվացրեք միայն ոչ լատինական այբուբեն օգտագործելու դեպքում; եթե օգտագործում եք լատինական այբուբեն ավելի լավ կլինի առանց այս օպցիայի ակտիվացման',
