    'Activate or deactivate your shop (It is a good idea to deactivate your shop while you perform maintenance. Please note that the webservice will not be disabled).' => 'Միացրեք կամ անջատեք խանութը: Սա խորհուրդ է տրվում կատարել տեխնիկակն աշխատանքների ժամանակ: Խնդրում ենք հիշել որ վեբ ծառայությունը չի անջատվելու',
