    'Automatically apply this value as a discount on all products for members of this customer group.' => 'Այս հաճախորդների խմբին ավտոմատ կերպով կիրառել այս արժեքը որպես զեղչ բոլոր ապրանքների նկատմամբ անդամների համար',
