    'The order in which products are displayed in the product list.' => 'Հերթականությունը ըստ որի ապրանքները ցուցադրվում են ապրանքի ցուցակում',
    'Set to "0" to disable this feature.' => 'Դրեք «0» այս հատականիշը անջատելու համար',
    'Display or hide the "add to cart" button on category pages for products that have attributes forcing customers to see product details.' => 'Ցուցադրել կամ թաքցնել "Ավելացնել զամբյուղի մեջ" կոճակը կատեգորիաների էջին այն ապրանքների համար որոնք ունեն հատկանիշներ, ստիպելով հաճախորդներին տեսնել ապրանքների մանրամասները.',
    'Activate or deactivate B2B mode. When this option is enabled, B2B features will be made available.' => 'Ակտիվացրեք կամ դեակտիվացրեք B2B ռեժիմը: Երբ այս հատկությունը միացած է, B2B հնարավորությունները մատչելի կլինեն',
    'Fee given for each visit.' => 'Տուրք յուրաքանչյուր այցելության համար',
    'Fee given for each order placed.' => 'Տուրք յուրաքանչյուր պատվերի տեղադրման համար',
    'Enable or disable token in the Front Office to improve PrestaShop\'s security.' => 'Միացրեք կամ անջատեք նշադրոշակները Խանութի մասում  PrestaShop-ի անվտանգությունն ավելացնելու համար',
    'The multistore feature allows you to manage several e-shops with one Back Office. If this feature is enabled, a "Multistore" page will be available in the "Advanced Parameters" menu.' => '«Մի քանի խանութներ» ֆունկցիան թույլ է տալիս կառավարել մի քանի խանութներ կառավարման մեկ վահանակից: Այս ֆունկցիան միացնելուց հետո «Լրացուցիչ կարգավորումներ» մենյուի մեջ կհայտնվի «Մի քանի խանութ» էջը',
    'If enabled, all messages will be saved in the "Customer Service" page under the "Customer" menu.' => 'Եթե միացած է, ապա բոլոր հաղորդագրությունները կպահպանվեն «Հաճախորդների Սպասարկում» էջին, «Հաճախորդներ» մենյուի տակ',
    'Only words this size or larger will be indexed.' => 'Կինդեքսավորվեն միայն այն բառերը, որոնք երկար են նշվածից',
    'Please enter the index words separated by a "|".' => 'Մուտքագրեք բառերը, իրարից բաժանված  «|» նշանով',
    'Search this word instead.' => 'Գտնել այս բառը',
    'You can\'t edit the shop group because the current shop belongs to a group with the "share" option enabled.' => 'Դուք չեք կարող խմբագրել խանութի խումբը որովհետեւ ընթացիկ խանութը պատկանում է «Մասնաբաժին» օպցիան միացրած  խմբին',
    'By selecting associated categories, you are choosing to share the categories between shops. Once associated between shops, any alteration of this category will impact every shop.' => 'Ընտրելով կապակցված կատեգորիաները Դուք թույլատրում եք օգտագործել կատեգորիաները տարբեր խանութների: Այն բանից հետո երբ խանութները կմիավորվեն իրար հետ, կատեգորիայի մեջ մտցված ցանկացած փոփոխություն կազդի բոլոր խանութների վրա որոնք նրա հետ հարաբերություն ունեն',
    'e.g. 10:00AM - 9:30PM' => 'օրինակ 10:00-21:30',
    'Show me more' => 'Ցույվ տալ ավելին',
    'If you\'d like to view all the visitors coming from Google, you can type "%google%" in this field. Alternatively, you can type "%google.fr%" if you want to view visitors coming from Google France, only.' => 'Եթե ցանկանում եք տեսնել Google-ից գալացող բոլոր այցելուներին, Դուք կարող եք տպել «%google%» այս դաշտում: Բացի դրանից Դուք կարող եք տպել «%google.fr%», եթե ուզում եք տեսնել միայն Google France-ից գալացող այցելուներին',
    'This is helpful because you can add tags or tokens in the links pointing to your website.' => 'Սա օգտակար է որովհետեւ Դուք կարող եք ավելացնել Թագեր կամ էլեկտրոնային բանալիներ հղումների մեջ որոնք ցույց կտան Ձեր կայքը',
    'Get help!' => 'Օգնություն ստանալ',
    'Direct traffic can be quite resource-intensive. You should consider enabling it only if you have a strong need for it.' => 'Եթե պահպանել անմիջական տրաֆիկը, ապա այն կարող է ավելացնել ծանրաբեռնվածությունը Ձեր սերվերի վրա, այս օպցիան միացրեք միայն հրատապ անհրաժեշտության դեպքում',
  ),
  'AdminShopparametersNotification' => 
  array (
    'Generate your "robots.txt" file by clicking on the following button (this will erase the old robots.txt file)' => 'Գեներացրեք «robots.txt» ֆայլ, կտտացնելով հետեւյալ կոճակի վրա (այն կջնջի Ձեր հին robots.txt ֆայլը).',
    'Here you can set the URL for your shop. If you migrate your shop to a new URL, remember to change the values below.' => 'Այստեղ Դուք կարող եք տեղադրել Ձեր խանութի հղումը:  Եթե Ձեր խանութը տեղափոխեք մեկ այլ հղումի, ապա չմոռանաք փոփոխել այս կարգավորումները պատշաճ կերպով',
    'The multistore option is enabled. If you want to change the URL of your shop, you must go to the "Multistore" page under the "Advanced Parameters" menu.' => 'Մի քանի խանութներ օպցիան միացված է: Եթե ուզում եք փոխել Ձեր խանութի հղումը պետք է գնաք «Մի քանի խանութ» էջը «Ընդլայնված պարամետրեր» մենյուի տակ',
    'You can only display the page list in a shop context.' => 'Դուք կարող եք միայն  ցուցադրել էջերի ցուցակը խանութի համատեքստում',
    'Create a blank .htaccess in your root directory.' => 'ստեղծեք ձեր արմատ կատալոգի մեջ դատարկ .htaccess ֆայլ',
    'You must define an SMTP server and an SMTP port. If you do not know it, use the PHP mail() function instead.' => 'Դուք պետք է նշեք SMTP սերվերը եւ նրա պորտը: Եթե դուք այն չգիտեք, ապա օգտագործեք PHP mail() ֆունկցիան:',
    'The discount value is incorrect (must be a percentage).' => 'Զեղչի արժեքը սխալ է (պետք է լինի տոկոս)',
