    'Warning: You won\'t be able to change the group of this shop if this shop belongs to a group with one of these options activated: Share Customers, Share Quantities or Share Orders.' => 'Զգուշացում. Դուք չեք կարող փոխել խանութի խունբը, եթե այս խանութը պատկանում է մի խմբի  հետեւյալ ակտիվացված օպցիաներով. Հաճախորդների մասնաբաժին, Քանակների մասնաբաժին կամ  Պատվերների մասնաբաժին',
    'You can only move your shop to a shop group with all "share" options disabled -- or to a shop group with no customers/orders.' => 'Դուք կարող եք Ձեր խանութը տեղափոխել խմբի մեջ, որի բոլոր «Մասնաբաժին» պարամետրերը անջատված են կամ որի մեջ չկան հաճախորդներ/ պատվերներ',
    'Click here to set a URL for this shop.' => 'Սեղմեք այստե խանութի Հղումը դնելու համար',
    'Caution: The discount applied to a category does not stack with the overall reduction but instead replaces it.' => 'Նախազգուշացում. զեղչը որը կիրառվում է այս կատեգորիայի համար,չի գումարվում ընդհանուր զեղչի հետ, այլ փոխարինում է նրան',
    'Only products that have this category as the default category will be affected.' => 'Ազդեցության տակ կընկնեն այն ապրանքները, որոն համար այս կատեգորիան հանդիսանում է դեֆոլտ',
